import React, {Component} from 'react';

class MiniCount extends Component {
    render() {
        return (
            <div className="col-md-3">
                <div >
                    <i className={this.props.counticon + " fa-2x"}></i>
                    <span className="counter">1,234,567</span>
                    <p className="count-text ">{this.props.counttitle}</p>
                </div>
            </div>
        );
    }
}

export default MiniCount;
